import './App.css';
import {Text,View} from "react-native"

function App() {
  return (
    <>
      <div className="bg-green-300 h-20 flex justify-center text-6xl">Chat-App</div>
      <div className='bg-gray-500 h-40 my-3 flex justify-center'>
        <form action="">
          <View style={StyleSheet.fieldSet}>
            <Text style={styles.legend}>LOGIN PAGE</Text>
            <label htmlFor="name_id"></label>
            <input type="text" name="name" id="name_id" placeholder='Enter UserName' />
          </View>
        </form>
      </div>
    </>
  );
}

export default App;
